INSERT INTO `questions` VALUES (1,1,'ds','<p>sadad</p>'),(2,1,'What are the main features of Java?','<p>Java is a popular programming language known for its <strong>portability, security, and object-oriented nature</strong>. Some of its key features include:</p><p><br></p><ul><li><strong>Platform Independence</strong>: Java programs run on the <strong>Java Virtual Machine (JVM)</strong>, making them platform-independent.</li><li><strong>Object-Oriented</strong>: Java follows the <strong>OOP (Object-Oriented Programming)</strong> paradigm.</li><li><strong>Automatic Memory Management</strong>: Java has <strong>garbage collection</strong>, so developers donâ€™t need to manage memory manually.</li><li><strong>Multithreading Support</strong>: Java supports <strong>multithreading</strong>, allowing concurrent execution of tasks.</li><li><strong>Security</strong>: Java has built-in <strong>security features</strong>, such as bytecode verification and a security manager.</li></ul><p><br></p><p><br></p>'),(3,1,'What is the difference between == and .equals() in Java?','<h2><code>==</code> compares <strong>memory addresses (references)</strong>.</h2><h2><code>.equals()</code> checks <strong>content equality</strong> (if overridden).</h2><h2><br></h2><h2>String s1 = new String(\"Java\");</h2><h2>String s2 = new String(\"Java\");</h2><h2>System.out.println(s1 == s2);&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;// false (different objects)</h2><h2>System.out.println(s1.equals(s2));&nbsp;&nbsp;&nbsp;// true (same content)</h2><p><br></p>'),(4,1,'Difference Between ArrayList and LinkedList in Java','<h2><strong>Difference Between </strong><code><strong>ArrayList</strong></code><strong> and </strong><code><strong>LinkedList</strong></code><strong> in Java</strong></h2><h2>Both <code>ArrayList</code> and <code>LinkedList</code> implement the <code>List</code> interface in Java but have different internal implementations and performance characteristics.</h2><h2><br></h2><h2><strong>1. Underlying Data Structure</strong></h2><h2><code><strong>ArrayList</strong></code>: Uses a <strong>dynamic array</strong> to store elements.</h2><h2><code><strong>LinkedList</strong></code>: Uses a <strong>doubly linked list</strong>, where each element (node) contains a reference to the next and previous node.</h2><h2><br></h2><h2><img src=\"data:image/png;base64,\" alt=\"\"></h2><h2>âœ… Use <code>ArrayList</code> when:</h2><h2>You need <strong>fast random access</strong> (O(1) access time).</h2><h2>You perform <strong>more reads and fewer insertions/deletions</strong>.</h2><h2>You need <strong>less memory overhead</strong> (since <code>LinkedList</code> stores additional node references).</h2><h2>âœ… Use <code>LinkedList</code> when:</h2><h2>You need <strong>frequent insertions or deletions in the middle</strong> (O(1) insertion/removal).</h2><h2>You have <strong>large lists with frequent modifications</strong> (avoids array resizing).</h2><h2>You donâ€™t need <strong>random access frequently</strong> (O(n) access time).</h2><p><br></p>'),(5,1,'What are the main interfaces in the Collection Framework?','<p><img src=\"data:image/png;base64,\" alt=\"\"></p>'),(6,2,'Explain call(), apply(), and bind()','<p>In JavaScript, <code>call()</code>, <code>apply()</code>, and <code>bind()</code> are methods that allow you to change the <code>this</code> context of a function. They are used when you want to explicitly set <code>this</code> when calling a function.</p><h2><strong>1ï¸âƒ£ call()</strong></h2><p>The <code>call()</code> method <strong>invokes a function</strong> with a specified <code>this</code> value and arguments <strong>passed individually</strong>.</p><p><br></p><h3><strong>Syntax</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">functionName.call(thisArg, arg1, arg2, ...)\n</pre><h3><strong>Example</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">const person = {\n    name: \"Alice\",\n    greet: function(city, country) {\n        console.log(`Hello, my name is ${this.name} and I\'m from ${city}, ${country}`);\n    }\n};\n\nconst anotherPerson = { name: \"Bob\" };\n\n// Using call() to set `this` to anotherPerson\nperson.greet.call(anotherPerson, \"New York\", \"USA\");\n</pre><h3><strong>Output</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">Hello, my name is Bob and I\'m from New York, USA\n</pre><p>? <strong>Key Takeaway</strong>:</p><p><br></p><ul><li><code>call()</code> <strong>immediately invokes</strong> the function.</li><li>Arguments are passed <strong>individually</strong>.</li></ul><h2><strong>2ï¸âƒ£ apply()</strong></h2><p>The <code>apply()</code> method is similar to <code>call()</code>, but it <strong>expects arguments as an array</strong>.</p><p><br></p><h3><strong>Syntax</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">functionName.apply(thisArg, [arg1, arg2, ...])\n</pre><h3><strong>Example</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">person.greet.apply(anotherPerson, [\"Paris\", \"France\"]);\n</pre><h3><strong>Output</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">Hello, my name is Bob and I\'m from Paris, France\n</pre><p>? <strong>Key Takeaway</strong>:</p><p><br></p><ul><li><code>apply()</code> <strong>immediately invokes</strong> the function.</li><li>Arguments are passed <strong>as an array</strong> (useful when you already have arguments in an array).</li></ul><h2><strong>3ï¸âƒ£ bind()</strong></h2><p>The <code>bind()</code> method <strong>does not invoke</strong> the function immediately. Instead, it <strong>returns a new function</strong> with <code>this</code> permanently bound.</p><p><br></p><h3><strong>Syntax</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">const newFunction = functionName.bind(thisArg, arg1, arg2, ...)\n</pre><h3><strong>Example</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">const boundFunction = person.greet.bind(anotherPerson, \"Berlin\", \"Germany\");\nboundFunction();  // Calling the function later\n</pre><h3><strong>Output</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">Hello, my name is Bob and I\'m from Berlin, Germany\n</pre><p>? <strong>Key Takeaway</strong>:</p><p><br></p><ul><li><code>bind()</code> <strong>does not call the function immediately</strong>.</li><li>It returns a <strong>new function</strong> with <code>this</code> permanently bound.</li></ul><h2><strong>? Key Differences</strong></h2><h2>   Method Invocation                        Arguments Passing           Returns New Function?    </h2><h2> <strong> call()</strong>     Immediately                       Individually                        âŒ No  </h2><h2>  <strong>apply()</strong> Immediately                       As an array            				âŒ No   </h2><h2><strong>  bind()</strong>   Later (when invoked)       Individually 							âœ… Yes  </h2><h2><br></h2><h2> <strong>When to Use What?</strong></h2><p><br></p><p><br></p><p>âœ… <strong>Use </strong><code><strong>call()</strong></code> â†’ When you need to invoke a function immediately and pass arguments one by one.</p><p> âœ… <strong>Use </strong><code><strong>apply()</strong></code> â†’ When you need to invoke a function immediately and have arguments in an array.</p><p> âœ… <strong>Use </strong><code><strong>bind()</strong></code> â†’ When you need to create a new function with a fixed <code>this</code> context and invoke it later.</p><p>Let me know if you need more examples! ?</p>'),(7,4,'Explaing database partitioning and techniques.','<h3><strong>Database Partitioning &amp; Techniques</strong></h3><h4><strong>What is Database Partitioning?</strong></h4><p>Database partitioning is the process of dividing a large database table into smaller, more manageable pieces (partitions) to improve performance, scalability, and maintainability. Each partition is stored separately but behaves as part of the same table from an applicationâ€™s perspective.</p><p>Partitioning helps in:</p><p><br></p><ul><li><strong>Query Performance</strong> â€“ Queries scan only relevant partitions instead of the entire table.</li><li><strong>Scalability</strong> â€“ Helps distribute data across multiple servers (horizontal scaling).</li><li><strong>Efficient Data Management</strong> â€“ Old partitions can be archived or deleted easily.</li><li><strong>Better Load Balancing</strong> â€“ Reduces contention by spreading read/write operations.</li></ul><h2><strong>Types of Database Partitioning Techniques</strong></h2><h3><strong>1. Horizontal Partitioning (Sharding)</strong></h3><ul><li><strong>Concept:</strong> Rows of a table are divided into multiple partitions based on a specific key. Each partition has the same schema but different rows.</li><li><strong>Example:</strong> A user database can be partitioned based on <code>user_id</code>, storing users with IDs (1-1000) in one partition, (1001-2000) in another, and so on.</li><li><strong>Use Case:</strong> Large-scale applications like social media platforms, e-commerce sites, distributed databases (Cassandra, MongoDB, etc.).</li></ul><h3><strong>2. Vertical Partitioning</strong></h3><ul><li><strong>Concept:</strong> Columns of a table are divided into different partitions. Some columns are stored in one partition, while others are stored separately.</li><li><strong>Example:</strong> A <code>users</code> table with columns <code>(user_id, name, email, password, profile_picture)</code> can be split into:</li><li class=\"ql-indent-1\">Partition 1: <code>(user_id, name, email, password)</code></li><li class=\"ql-indent-1\">Partition 2: <code>(user_id, profile_picture)</code></li><li><strong>Use Case:</strong> When frequently accessed columns are stored together for better query performance.</li></ul><h3><strong>3. Range Partitioning</strong></h3><ul><li><strong>Concept:</strong> Data is partitioned based on a range of values in a column.</li><li><strong>Example:</strong> A sales table can be partitioned by year:</li><li class=\"ql-indent-1\">Partition 1: Orders from <strong>2022</strong></li><li class=\"ql-indent-1\">Partition 2: Orders from <strong>2023</strong></li><li class=\"ql-indent-1\">Partition 3: Orders from <strong>2024</strong></li><li><strong>Use Case:</strong> Time-series databases, logs, transactional data.</li></ul><h3><strong>4. List Partitioning</strong></h3><ul><li><strong>Concept:</strong> Data is divided based on a predefined list of values in a column.</li><li><strong>Example:</strong> A customer table can be partitioned by region:</li><li class=\"ql-indent-1\">Partition 1: Customers from <strong>USA</strong></li><li class=\"ql-indent-1\">Partition 2: Customers from <strong>Europe</strong></li><li class=\"ql-indent-1\">Partition 3: Customers from <strong>Asia</strong></li><li><strong>Use Case:</strong> When data naturally falls into distinct categories.</li></ul><h3><strong>5. Hash Partitioning</strong></h3><ul><li><strong>Concept:</strong> A hash function is applied to a column value to determine the partition in which the data should be stored.</li><li><strong>Example:</strong> If a table has 4 partitions and <code>user_id % 4</code> determines the partition number, then:</li><li class=\"ql-indent-1\"><code>user_id 101</code> â†’ Partition 1</li><li class=\"ql-indent-1\"><code>user_id 202</code> â†’ Partition 2</li><li class=\"ql-indent-1\"><code>user_id 303</code> â†’ Partition 3</li><li><strong>Use Case:</strong> Evenly distributing data across multiple partitions to prevent hotspots.</li></ul><h3><strong>6. Composite Partitioning (Hybrid Partitioning)</strong></h3><ul><li><strong>Concept:</strong> A combination of two or more partitioning strategies.</li><li><strong>Example:</strong> First partition by <strong>range</strong> (year), then apply <strong>hash</strong> partitioning on <code>user_id</code>.</li><li><strong>Use Case:</strong> Complex data sets needing both scalability and fast query performance.</li></ul><p>Sure! Here\'s the same information in a clearer bullet-point format:</p><p><br></p><p><br></p><p><br></p><h3><strong>Choosing the Right Partitioning Strategy</strong></h3><p>1ï¸âƒ£ <strong>Horizontal Partitioning (Sharding)</strong></p><p><br></p><ul><li><strong>Best For:</strong> Large-scale distributed databases</li><li><strong>Example Use Cases:</strong> Social media, e-commerce, user data</li></ul><p>2ï¸âƒ£ <strong>Vertical Partitioning</strong></p><p><br></p><ul><li><strong>Best For:</strong> Frequently accessed columns</li><li><strong>Example Use Cases:</strong> Banking transactions, analytics</li></ul><p>3ï¸âƒ£ <strong>Range Partitioning</strong></p><p><br></p><ul><li><strong>Best For:</strong> Time-based data</li><li><strong>Example Use Cases:</strong> Logs, sales, historical records</li></ul><p>4ï¸âƒ£ <strong>List Partitioning</strong></p><p><br></p><ul><li><strong>Best For:</strong> Categorized data</li></ul><ol><li><strong>Example Use Cases:</strong> Country-based users, departments</li></ol><p>5ï¸âƒ£ <strong>Hash Partitioning</strong></p><p><br></p><ul><li><strong>Best For:</strong> Even data distribution</li><li><strong>Example Use Cases:</strong> Load balancing in distributed systems</li></ul><p>6ï¸âƒ£ <strong>Composite Partitioning (Hybrid)</strong></p><p><br></p><ul><li><strong>Best For:</strong> Complex scenarios</li><li><strong>Example Use Cases:</strong> Multi-tenant SaaS applications</li></ul>'),(8,4,'Explain redis and give me all the usecases','<h1><strong>Redis: In-Depth Explanation</strong></h1><h3><strong>What is Redis?</strong></h3><p>Redis (Remote Dictionary Server) is an <strong>in-memory, key-value data store</strong> known for its <strong>high speed and flexibility</strong>. It can be used as:</p><p><br></p><ul><li>A <strong>cache</strong> to store frequently accessed data</li><li>A <strong>database</strong> for fast key-value lookups</li><li>A <strong>message broker</strong> for real-time communication</li><li>A <strong>session store</strong> for web applications</li></ul><p>? <strong>Key Features:</strong></p><p> âœ… <strong>In-memory storage:</strong> Data is stored in RAM for lightning-fast access</p><p> âœ… <strong>Persistence options:</strong> Can save snapshots or append-only logs to disk</p><p> âœ… <strong>Data structures support:</strong> Strings, Lists, Sets, Sorted Sets, Hashes, Bitmaps, Streams, etc.</p><p> âœ… <strong>Replication &amp; Clustering:</strong> Supports <strong>Master-Slave</strong> replication and sharding for scalability</p><p> âœ… <strong>Pub/Sub Messaging:</strong> Can be used for event-driven architecture</p><p> âœ… <strong>Transactions &amp; Scripting:</strong> Supports atomic transactions and Lua scripting</p><p> âœ… <strong>Lightweight &amp; Fast:</strong> Can perform <strong>100,000+ operations per second</strong></p><h2><strong>Use Cases of Redis</strong></h2><h3><strong>1. Caching (Most Common Use Case)</strong></h3><p>Redis is widely used as a <strong>cache layer</strong> to store frequently accessed data, reducing database load and improving response times.</p><p> ? <strong>Example:</strong></p><ul><li>Storing <strong>session data</strong> in web applications (e.g., login sessions).</li><li>Caching <strong>database query results</strong> to avoid frequent queries.</li><li>Storing <strong>API responses</strong> to minimize external API calls.</li></ul><h3><strong>2. Real-Time Analytics</strong></h3><p>Redis is ideal for real-time analytics because of its <strong>fast read/write operations</strong>.</p><p> ? <strong>Example:</strong></p><ul><li>Counting <strong>page views</strong> or <strong>likes</strong> in social media apps.</li><li>Storing real-time <strong>leaderboards</strong> in gaming apps.</li><li>Tracking <strong>stock prices</strong> in trading applications.</li></ul><h3><strong>3. Message Queue (Pub/Sub)</strong></h3><p>Redis provides a <strong>Publish-Subscribe (Pub/Sub)</strong> model to enable real-time event messaging.</p><p> ? <strong>Example:</strong></p><ul><li>Chat applications (e.g., WhatsApp, Slack).</li><li>Live notifications (e.g., order updates in food delivery apps).</li><li>Event-driven microservices communication.</li></ul><h3><strong>4. Session Store</strong></h3><p>Redis is often used as a <strong>session store</strong> for web applications because of its <strong>low latency</strong>.</p><p> ? <strong>Example:</strong></p><ul><li>Storing user <strong>session tokens</strong> (e.g., in e-commerce websites).</li><li>Managing <strong>shopping cart data</strong> for logged-in users.</li></ul><h3><strong>5. Distributed Locking</strong></h3><p>Redis provides <strong>atomic operations</strong>, making it useful for <strong>distributed locking</strong> in multi-server systems.</p><p> ? <strong>Example:</strong></p><ul><li>Preventing <strong>multiple processes from modifying the same resource</strong> at once.</li><li>Ensuring <strong>only one instance of a job runs</strong> in distributed applications.</li></ul><h3><strong>6. Rate Limiting (API Throttling)</strong></h3><p>Redis can enforce <strong>rate limiting</strong> to prevent API abuse.</p><p> ? <strong>Example:</strong></p><ul><li>Allowing <strong>only 100 requests per minute</strong> per user in an API.</li><li>Preventing brute-force login attempts by <strong>limiting failed login attempts</strong>.</li></ul><h3><strong>7. Leaderboards &amp; Counters</strong></h3><p>Redis <strong>Sorted Sets</strong> are used for <strong>ranking and counting</strong>.</p><p> ? <strong>Example:</strong></p><ul><li><strong>Gaming leaderboards</strong> (e.g., top players ranked by score).</li><li><strong>Tracking social media trends</strong> (e.g., most liked posts).</li></ul><h3><strong>8. Streaming &amp; IoT Applications</strong></h3><p>Redis <strong>Streams</strong> enable real-time data streaming.</p><p> ? <strong>Example:</strong></p><ul><li>Collecting <strong>sensor data</strong> from IoT devices.</li><li>Processing <strong>log data</strong> in real-time.</li></ul><h2><strong>Redis Eviction Policies (Cache Expiration Strategies)</strong></h2><p>Since Redis stores data in <strong>RAM</strong>, there must be a strategy to handle <strong>memory overflow</strong> when it reaches its limit. Redis uses <strong>eviction policies</strong> to remove old keys when new data needs space.</p><p><br></p><h3><strong>1. No Eviction (default)</strong></h3><p>? <strong>Policy:</strong> If memory is full, Redis returns an error for new write operations.</p><p> ? <strong>Use Case:</strong> When Redis is used as a <strong>database</strong> and data loss is unacceptable.</p><h3><strong>2. Volatile-lru (Least Recently Used)</strong></h3><p>? <strong>Policy:</strong> Removes <strong>least recently used</strong> keys among keys with an expiration time (<code>TTL</code>).</p><p> ? <strong>Use Case:</strong> Best for <strong>session caches</strong> where expired keys should be prioritized.</p><h3><strong>3. Allkeys-lru (Least Recently Used)</strong></h3><p>? <strong>Policy:</strong> Removes <strong>least recently used</strong> keys <strong>regardless of TTL</strong>.</p><p> ? <strong>Use Case:</strong> When Redis is used <strong>purely as a cache</strong>.</p><h3><strong>4. Volatile-lfu (Least Frequently Used)</strong></h3><p>? <strong>Policy:</strong> Removes <strong>least frequently accessed</strong> keys with an expiration time.</p><p> ? <strong>Use Case:</strong> Works well for <strong>dynamic caches</strong> where some data is rarely accessed.</p><h3><strong>5. Allkeys-lfu (Least Frequently Used)</strong></h3><p>? <strong>Policy:</strong> Removes <strong>least frequently accessed</strong> keys, even if they donâ€™t have an expiration.</p><p> ? <strong>Use Case:</strong> For caches that store <strong>long-term but rarely accessed data</strong>.</p><h3><strong>6. Volatile-random</strong></h3><p>? <strong>Policy:</strong> Randomly removes a key <strong>with an expiration (</strong><code><strong>TTL</strong></code><strong>)</strong>.</p><p> ? <strong>Use Case:</strong> If <strong>random eviction</strong> is acceptable for expired keys.</p><h3><strong>7. Allkeys-random</strong></h3><p>? <strong>Policy:</strong> Randomly removes <strong>any key</strong>, regardless of expiration.</p><p> ? <strong>Use Case:</strong> Works well for <strong>non-critical cache</strong> (e.g., temporary storage).</p><h3><strong>8. Volatile-ttl</strong></h3><p>? <strong>Policy:</strong> Removes keys <strong>with the shortest remaining TTL</strong> first.</p><p> ? <strong>Use Case:</strong> Ideal for <strong>time-sensitive cache</strong> (e.g., real-time notifications).</p><h2><strong>Redis Persistence (Data Durability Options)</strong></h2><p>By default, Redis stores data <strong>in-memory</strong> but offers persistence methods to recover data after a restart.</p><p><br></p><h3><strong>1. RDB (Redis Database File)</strong></h3><p>? <strong>How it works:</strong> Takes periodic <strong>snapshots</strong> of the dataset and writes them to disk.</p><p> ? <strong>Pros:</strong></p><p> âœ” Faster recovery after a crash</p><p> âœ” Lower disk I/O impact</p><p> ? <strong>Cons:</strong></p><p> âœ˜ Data loss if Redis crashes before the next snapshot</p><h3><strong>2. AOF (Append-Only File)</strong></h3><p>? <strong>How it works:</strong> Logs every write operation to disk in real-time.</p><p> ? <strong>Pros:</strong></p><p> âœ” More reliable (minimizes data loss)</p><p> âœ” Can replay logs to restore data</p><p> ? <strong>Cons:</strong></p><p> âœ˜ Slower than RDB due to continuous writing</p><h3><strong>3. RDB + AOF (Hybrid Mode)</strong></h3><p>? <strong>How it works:</strong> Uses <strong>RDB for faster recovery</strong> and <strong>AOF for durability</strong>.</p><p> ? <strong>Best Use Case:</strong> When you need both <strong>performance and reliability</strong>.</p><h2><strong>Redis Replication &amp; Clustering</strong></h2><h3><strong>1. Replication (Master-Slave Architecture)</strong></h3><p>? <strong>How it works:</strong> A <strong>primary (master) node</strong> replicates data to <strong>multiple read-only slave nodes</strong>.</p><p> ? <strong>Use Case:</strong> Improves <strong>read scalability</strong> by distributing read requests.</p><h3><strong>2. Redis Cluster (Sharding)</strong></h3><p>? <strong>How it works:</strong> Data is <strong>automatically split</strong> across multiple nodes for horizontal scaling.</p><p> ? <strong>Use Case:</strong> Large-scale <strong>distributed caching</strong> or key-value storage.</p><h2><br></h2><p>Redis is a <strong>powerful in-memory database</strong> used for caching, real-time analytics, messaging, and more. It provides <strong>various eviction policies, persistence options, and replication techniques</strong> to balance speed, durability, and scalability.</p><p><br></p>'),(9,2,'Exaplin clouser and real worl examples','<p>In JavaScript, a closure is a powerful and fundamental concept that allows a function to \"remember\" and access its lexical scope (the environment in which it was created) even when that function is executed outside that scope. Closures are created every time a function is created, at function creation time.</p><p>How Closures Work</p><p>A closure is formed when:</p><p><br></p><ol><li>A function is defined inside another function (the outer function).</li><li>The inner function has access to the variables and parameters of the outer function, even after the outer function has finished executing.</li></ol><p>This happens because the inner function retains a reference to its lexical environment, which includes the variables and parameters of the outer function.</p><p>Example of a Closure</p><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">function outerFunction() {\n    let outerVariable = \"I\'m from the outer function!\";\n\n    function innerFunction() {\n        console.log(outerVariable); // Accessing outerVariable from the outer scope\n    }\n\n    return innerFunction;\n}\n\nconst closureExample = outerFunction(); // outerFunction finishes execution\nclosureExample(); // Logs: \"I\'m from the outer function!\"\n</pre><p>Explanation:</p><p><br></p><ol><li><code>outerFunction</code> is called, and it defines a local variable <code>outerVariable</code>.</li><li><code>innerFunction</code> is defined inside <code>outerFunction</code> and has access to <code>outerVariable</code>.</li><li><code>outerFunction</code> returns <code>innerFunction</code> (but does not execute it).</li><li>When <code>outerFunction</code> finishes executing, its scope would normally be destroyed. However, because <code>innerFunction</code> retains a reference to its lexical environment (including <code>outerVariable</code>), the variable is preserved.</li><li>When <code>closureExample()</code> is called, it logs the value of <code>outerVariable</code>, even though <code>outerFunction</code> has already finished executing.</li></ol><p>Key Characteristics of Closures</p><p><br></p><ol><li>Access to Outer Scope: The inner function can access variables and parameters of the outer function, even after the outer function has returned.</li><li>Data Encapsulation: Closures can be used to create private variables or functions, which are not accessible from outside the function.</li><li>Memory Efficiency: Closures can help optimize memory usage by retaining only the necessary variables in memory.</li></ol><p>Practical Uses of Closures</p><p><br></p><ol><li>Data Privacy (Encapsulation):</li></ol><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">function createCounter() {\n    let count = 0; // Private variable\n    return function() {\n        count++;\n        return count;\n    };\n}\n\nconst counter = createCounter();\nconsole.log(counter()); // 1\nconsole.log(counter()); // 2\nconsole.log(counter()); // 3\n</pre><p>Here, <code>count</code> is private and cannot be accessed directly from outside the <code>createCounter</code> function.</p><p><br></p><ol><li>Callbacks and Event Handlers:</li></ol><p>Closures are often used in asynchronous programming, such as with callbacks or event handlers, to maintain state.</p><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">function onClickHandler() {\n    let clicked = 0;\n    return function() {\n        clicked++;\n        console.log(`Button clicked ${clicked} times.`);\n    };\n}\n\nconst handleClick = onClickHandler();\ndocument.getElementById(\"myButton\").addEventListener(\"click\", handleClick);\n</pre><ol><li>Function Factories:</li></ol><p>Closures can be used to create functions with specific behavior based on parameters.</p><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">function createMultiplier(multiplier) {\n    return function(number) {\n        return number * multiplier;\n    };\n}\n\nconst double = createMultiplier(2);\nconst triple = createMultiplier(3);\n\nconsole.log(double(5)); // 10\nconsole.log(triple(5)); // 15\n</pre><ol><li>Currying:</li></ol><p>Closures enable currying, where a function is transformed into a sequence of functions, each taking a single argument.</p><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">function add(a) {\n    return function(b) {\n        return a + b;\n    };\n}\n\nconst addFive = add(5);\nconsole.log(addFive(10)); // 15\n</pre><p>Common Pitfalls with Closures</p><p><br></p><ol><li>Memory Leaks:</li></ol><p>Since closures retain references to their outer scope, they can cause memory leaks if not managed properly, especially in long-running applications.</p><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">function createHeavyClosure() {\n    let largeArray = new Array(1000000).fill(\"data\");\n    return function() {\n        console.log(largeArray.length);\n    };\n}\n\nconst heavyClosure = createHeavyClosure();\n// largeArray is retained in memory even if it\'s no longer needed.\n</pre><ol><li>Unexpected Behavior in Loops:</li></ol><p>When using closures inside loops, you might encounter unexpected behavior due to the way JavaScript handles variable scoping.</p><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">for (var i = 1; i &lt;= 3; i++) {\n    setTimeout(function() {\n        console.log(i); // Logs 4, 4, 4 (not 1, 2, 3)\n    }, 1000);\n}\n</pre><p>To fix this, use <code>let</code> instead of <code>var</code> or create a new scope for each iteration:</p><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">for (let i = 1; i &lt;= 3; i++) {\n    setTimeout(function() {\n        console.log(i); // Logs 1, 2, 3\n    }, 1000);\n}\n</pre><p>Conclusion</p><p>Closures are a fundamental concept in JavaScript that enable powerful programming patterns like data encapsulation, function factories, and currying. They allow functions to retain access to their lexical scope, even after the outer function has finished executing. However, they should be used carefully to avoid memory leaks and unexpected behavior.</p>'),(10,2,'Check the answer for question:',''),(11,2,'Check the answer for question:','<p>The behavior you\'re observing is due to how JavaScript handles variable scoping, particularly with <code>var</code> and <code>let</code>, and how closures interact with asynchronous code like <code>setTimeout</code>.</p><p>Explanation of the Problem</p><p>Using <code>var</code>:</p><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">for (var i = 1; i &lt;= 3; i++) {\n    setTimeout(function() {\n        console.log(i); // Logs 4, 4, 4 (not 1, 2, 3)\n    }, 1000);\n}\n</pre><ol><li>Scope of <code>var</code>:</li></ol><ul><li class=\"ql-indent-1\"><code>var</code> is function-scoped, meaning it is not limited to the block in which it is declared (e.g., the <code>for</code> loop). Instead, it is scoped to the nearest function (or globally, if no function exists).</li><li class=\"ql-indent-1\">In this case, <code>i</code> is declared in the global scope (or the enclosing function\'s scope), and there is only one <code>i</code> variable shared across all iterations of the loop.</li></ul><ol><li>Behavior of <code>setTimeout</code>:</li></ol><ul><li class=\"ql-indent-1\"><code>setTimeout</code> is asynchronous. It schedules the callback function to run after the specified delay (1 second in this case), but it does not execute immediately.</li><li class=\"ql-indent-1\">By the time the callback runs, the <code>for</code> loop has already completed, and the value of <code>i</code> has reached <code>4</code> (since the loop condition <code>i &lt;= 3</code> fails when <code>i</code> becomes <code>4</code>).</li></ul><ol><li>Closure and Shared Variable:</li></ol><ul><li class=\"ql-indent-1\">The callback function inside <code>setTimeout</code> forms a closure and retains a reference to the same <code>i</code> variable.</li><li class=\"ql-indent-1\">When the callback runs, it logs the current value of <code>i</code>, which is <code>4</code> at that point (since the loop has finished).</li></ul><p>Output:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">4\n4\n4\n</pre><p>Fixing the Problem</p><p>Using <code>let</code>:</p><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">for (let i = 1; i &lt;= 3; i++) {\n    setTimeout(function() {\n        console.log(i); // Logs 1, 2, 3\n    }, 1000);\n}\n</pre><ol><li>Scope of <code>let</code>:</li></ol><ul><li class=\"ql-indent-1\"><code>let</code> is block-scoped, meaning it is limited to the block in which it is declared (e.g., the <code>for</code> loop).</li><li class=\"ql-indent-1\">In each iteration of the loop, a new <code>i</code> variable is created, and it is scoped to that specific iteration.</li></ul><ol><li>Behavior of <code>setTimeout</code>:</li></ol><ul><li class=\"ql-indent-1\">The callback function inside <code>setTimeout</code> still forms a closure, but now it captures the <code>i</code> variable specific to that iteration.</li><li class=\"ql-indent-1\">When the callback runs, it logs the value of <code>i</code> that was captured at the time the callback was created.</li></ul><p>Result:</p><p>Each callback logs the correct value of <code>i</code> for its respective iteration.</p><p>Output:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">1\n2\n3\n</pre><p>Alternative Fix: Using an IIFE (Immediately Invoked Function Expression)</p><p>If you cannot use <code>let</code> (e.g., in older JavaScript environments), you can create a new scope for each iteration using an IIFE:</p><p>JavaScript</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">for (var i = 1; i &lt;= 3; i++) {\n    (function(i) {\n        setTimeout(function() {\n            console.log(i); // Logs 1, 2, 3\n        }, 1000);\n    })(i);\n}\n</pre><ol><li>How It Works:</li></ol><ul><li class=\"ql-indent-1\">The IIFE creates a new function scope for each iteration.</li><li class=\"ql-indent-1\">The current value of <code>i</code> is passed as an argument to the IIFE, creating a new variable <code>i</code> in each iteration\'s scope.</li><li class=\"ql-indent-1\">The callback inside <code>setTimeout</code> captures the <code>i</code> specific to that iteration.</li></ul><ol><li>Result:</li></ol><p>Each callback logs the correct value of <code>i</code> for its respective iteration.</p><p>Output:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">1\n2\n3\n</pre><p>Key Takeaways</p><p><br></p><ul><li><code>var</code> vs. <code>let</code>: <code>var</code> is function-scoped, while <code>let</code> is block-scoped. Using <code>let</code> in loops ensures that each iteration has its own variable.</li><li>Closures and Asynchronous Code: Closures capture references to variables, not their values at the time of creation. If the variable changes (e.g., in a loop), the closure will reflect the updated value.</li><li>Fixing the Issue: Use <code>let</code> for block-scoping or an IIFE to create a new scope for each iteration.</li></ul><p>By understanding these concepts, you can avoid common pitfalls when working with closures and asynchronous code in JavaScript.</p>'),(12,2,'Link of interview questions','<p>https://github.com/sudheerj/javascript-interview-questions</p>'),(13,2,'Explain prototype','<h3><strong>Prototype in JavaScript</strong></h3><p>In JavaScript, <strong>prototype</strong> is a built-in mechanism that allows objects to inherit properties and methods from other objects. Every JavaScript function has a <code>prototype</code> property, which is an object that new instances inherit when created using the <code>new</code> keyword.</p><h3><strong>How Prototype Works</strong></h3><ol><li><strong>Each function in JavaScript has a </strong><code><strong>prototype</strong></code><strong> property</strong> (except arrow functions).</li><li><strong>Objects created using a constructor function inherit properties from that constructorâ€™s prototype.</strong></li><li><strong>JavaScript uses a prototype chain</strong> to look up properties and methods when they are accessed on an object.</li></ol><h3><strong>Example of Prototype Inheritance</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">// Constructor function\nfunction Person(name) {\n    this.name = name;\n}\n\n// Adding a method to the prototype\nPerson.prototype.greet = function() {\n    return `Hello, my name is ${this.name}`;\n};\n\n// Creating an object\nconst user = new Person(\"Alice\");\n\nconsole.log(user.greet()); // Output: Hello, my name is Alice\n</pre><p>Here, <code>user</code> does not have a <code>greet</code> method directly, but JavaScript looks up the prototype chain and finds it on <code>Person.prototype</code>.</p><h3><strong>Prototype Chain</strong></h3><p>If JavaScript doesnâ€™t find a property or method on an object, it looks up the prototype chain.</p><p>Example:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">console.log(user.toString()); \n// \'toString\' is not in user but exists in Object.prototype, so it\'s inherited.\n</pre><h3><strong>Modifying Built-in Prototypes</strong></h3><p>You can modify built-in prototypes, but it\'s generally not recommended:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">Array.prototype.customMethod = function() {\n    return \"This is a custom array method!\";\n};\n\nconst arr = [1, 2, 3];\nconsole.log(arr.customMethod()); // Output: This is a custom array method!\n</pre><h3><strong>Key Points</strong></h3><ul><li>Prototypes enable inheritance in JavaScript.</li><li>Objects inherit properties and methods from their constructorâ€™s prototype.</li><li>The prototype chain allows property/method lookup across multiple levels.</li><li>Modifying built-in prototypes can cause conflicts and is not recommended.</li></ul><p>Would you like a deeper explanation with more examples? ?</p><h2><strong>1. Constructor Functions &amp; Prototype Methods</strong></h2><p>When you create a function and use it as a constructor, the new objects you create inherit properties from that functionâ€™s prototype.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">function Person(name, age) {\n  this.name = name;\n  this.age = age;\n}\n\n// Add a method to Person\'s prototype\nPerson.prototype.greet = function() {\n  return `Hello, my name is ${this.name}`;\n};\n\nconst alice = new Person(\"Alice\", 30);\nconst bob = new Person(\"Bob\", 25);\n\nconsole.log(alice.greet()); // Output: Hello, my name is Alice\nconsole.log(bob.greet());   // Output: Hello, my name is Bob\n</pre><p><strong>Interview Insight:</strong></p><p><br></p><ul><li><strong>Question:</strong> <em>Why do we add methods to the prototype rather than defining them in the constructor?</em></li><li><strong>Answer:</strong> Adding methods to the prototype means that all instances share the same function reference. This is memory efficient since the function is not recreated for each instance.</li></ul><h2><strong>2. Prototype Chain Lookup</strong></h2><p>JavaScript uses the prototype chain to look up properties. If a property or method is not found on an object, JavaScript will search its prototype, then the prototypeâ€™s prototype, and so on.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">function Animal(name) {\n  this.name = name;\n}\n\nAnimal.prototype.speak = function() {\n  return `${this.name} makes a noise.`;\n};\n\nfunction Dog(name, breed) {\n  Animal.call(this, name); // Call the parent constructor\n  this.breed = breed;\n}\n\n// Inherit from Animal\nDog.prototype = Object.create(Animal.prototype);\nDog.prototype.constructor = Dog;\n\n// Add a method specific to Dog\nDog.prototype.bark = function() {\n  return `${this.name} barks.`;\n};\n\nconst rex = new Dog(\"Rex\", \"German Shepherd\");\n\nconsole.log(rex.speak()); // Output: Rex makes a noise. (inherited from Animal)\nconsole.log(rex.bark());  // Output: Rex barks.\n</pre><p><strong>Interview Insight:</strong></p><p><br></p><ul><li><strong>Question:</strong> <em>Explain the role of </em><code><em>Object.create</em></code><em> in this example.</em></li><li><strong>Answer:</strong> <code>Object.create(Animal.prototype)</code> creates a new object that inherits from <code>Animal.prototype</code> and assigns it to <code>Dog.prototype</code>, effectively linking the prototype chain so that Dog instances can access methods on Animalâ€™s prototype.</li></ul><h2><strong>3. Understanding </strong><code><strong>__proto__</strong></code><strong> vs. </strong><code><strong>prototype</strong></code></h2><ul><li><code><strong>prototype</strong></code><strong>:</strong> A property available on constructor functions. It is used to define properties and methods that should be inherited by instances created by that constructor.</li><li><code><strong>__proto__</strong></code><strong>:</strong> A property available on every object (in most browsers) that points to the objectâ€™s prototype.</li></ul><pre class=\"ql-syntax\" spellcheck=\"false\">function Car(make) {\n  this.make = make;\n}\n\nCar.prototype.getMake = function() {\n  return this.make;\n};\n\nconst myCar = new Car(\"Toyota\");\n\nconsole.log(myCar.getMake()); // Output: Toyota\n\n// __proto__ points to Car.prototype\nconsole.log(myCar.__proto__ === Car.prototype); // Output: true\n</pre><p><strong>Interview Insight:</strong></p><p><br></p><ul><li><strong>Question:</strong> <em>Why should you be cautious when modifying built-in prototypes?</em></li><li><strong>Answer:</strong> Modifying built-in prototypes (like <code>Array.prototype</code> or <code>Object.prototype</code>) can lead to unexpected behavior and conflicts in code, especially if multiple libraries are involved. It\'s generally considered bad practice to alter built-in objects.</li></ul><h2><strong>4. Performance Considerations</strong></h2><p>Using prototypes is generally more memory efficient. When methods are defined on the prototype, all instances share the same method rather than each instance carrying its own copy.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">function Person(name) {\n  this.name = name;\n  // Avoid this: this.greet = function() { return `Hello, ${this.name}`; }\n}\n\nPerson.prototype.greet = function() {\n  return `Hello, ${this.name}`;\n};\n\nconst person1 = new Person(\"John\");\nconst person2 = new Person(\"Jane\");\n\nconsole.log(person1.greet === person2.greet); // Output: true\n</pre><p><strong>Interview Insight:</strong></p><p><br></p><ul><li><strong>Question:</strong> <em>How does using prototypes improve performance compared to adding methods directly inside the constructor?</em></li><li><strong>Answer:</strong> By using the prototype, all instances share the same function reference for methods, reducing memory consumption compared to creating a new function for every instance.</li></ul><h2><strong>5. ES6 Classes and Prototypes</strong></h2><p>ES6 classes are essentially syntactical sugar over the prototypal inheritance model. They still use prototypes under the hood.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">class Person {\n  constructor(name) {\n    this.name = name;\n  }\n  \n  greet() {\n    return `Hello, my name is ${this.name}`;\n  }\n}\n\nconst john = new Person(\"John\");\nconsole.log(john.greet()); // Output: Hello, my name is John\n\n// Behind the scenes:\nconsole.log(Person.prototype.greet); // This is the same function used by john.greet()\n</pre><p><strong>Interview Insight:</strong></p><p><br></p><ul><li><strong>Question:</strong> <em>What is the relationship between ES6 classes and prototypes?</em></li><li><strong>Answer:</strong> ES6 classes are a more modern and clearer syntax for creating constructor functions and managing prototypes. Methods defined in a class body are actually added to the constructorâ€™s prototype.</li></ul><p>These examples and insights cover a broad range of topics about prototypes in JavaScript, from basic inheritance to more advanced prototype chain concepts, which are often discussed in interviews. Feel free to ask if you need further clarification or more examples!</p>'),(14,2,'prototype vs __proto__','<h3><code><strong>__proto__</strong></code><strong> vs </strong><code><strong>prototype</strong></code><strong> in JavaScript</strong></h3><p>Both <code>__proto__</code> and <code>prototype</code> deal with <strong>prototypal inheritance</strong> in JavaScript, but they are used in different ways. Letâ€™s break it down with clear explanations and examples.</p><h2><strong>1ï¸âƒ£ </strong><code><strong>prototype</strong></code><strong> (Used in Constructor Functions &amp; Classes)</strong></h2><ul><li><code>prototype</code> is a <strong>property of constructor functions</strong> (including classes in ES6).</li><li>It is an <strong>object that holds shared methods and properties</strong> that instances of the constructor inherit.</li><li>When you create an object using <code>new</code>, the created objectâ€™s <code>__proto__</code> points to the constructorâ€™s <code>prototype</code>.</li></ul><h3><strong>Example</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">function Person(name) {\n  this.name = name;\n}\n\n// Adding a method to the prototype\nPerson.prototype.sayHello = function() {\n  return `Hello, my name is ${this.name}`;\n};\n\nlet person1 = new Person(\"Alice\");\nlet person2 = new Person(\"Bob\");\n\nconsole.log(person1.sayHello()); // Output: Hello, my name is Alice\nconsole.log(person2.sayHello()); // Output: Hello, my name is Bob\nconsole.log(person1.__proto__ === Person.prototype); // Output: true\n</pre><p>? <strong>Key Takeaways</strong></p><p><br></p><ul><li>The <strong>prototype</strong> object is shared among all instances of the constructor.</li><li>Modifying <code>Person.prototype</code> affects all objects created from <code>Person</code>.</li></ul><h2><strong>2ï¸âƒ£ </strong><code><strong>__proto__</strong></code><strong> (Prototype Chain)</strong></h2><ul><li><code>__proto__</code> is a <strong>reference to an objectâ€™s prototype</strong> (not a function property).</li><li>Every object in JavaScript has <code>__proto__</code>, which links it to its prototype.</li><li>It is part of the <strong>prototype chain</strong>, which JavaScript follows when looking for properties.</li></ul><h3><strong>Example</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">let obj = { key: \"value\" };\nconsole.log(obj.__proto__ === Object.prototype); // Output: true\n</pre><p>Here, <code>obj</code> inherits from <code>Object.prototype</code>.</p><p>? <strong>Key Takeaways</strong></p><p><br></p><ul><li><code>__proto__</code> is an <strong>internal reference</strong> to an object\'s prototype.</li><li>It helps in <strong>prototype chain lookup</strong> for methods and properties.</li><li>It is <strong>not recommended</strong> to modify <code>__proto__</code> directly.</li></ul><h2><strong>3ï¸âƒ£ Difference Between </strong><code><strong>prototype</strong></code><strong> and </strong><code><strong>__proto__</strong></code></h2><h2>   Feature <code>prototype</code> <code>__proto__</code>     <strong>Type</strong> Property of a constructor function Property of an object   <strong>Usage</strong> Used for defining shared properties/methods Used to access an object\'s prototype   <strong>Access</strong> <code>Function.prototype</code> <code>object.__proto__</code>   <strong>Modification</strong> Can be modified to add methods Should not be modified directly   <strong>Example</strong> <code>Person.prototype.sayHello = function() {...}</code> <code>obj.__proto__ === Object.prototype</code>   <strong>4ï¸âƒ£ Visual Representation</strong></h2><pre class=\"ql-syntax\" spellcheck=\"false\">function Animal() {}\n\nAnimal.prototype.species = \"Mammal\";\n\nlet dog = new Animal();\n\nconsole.log(dog.species); // \"Mammal\"\nconsole.log(dog.__proto__ === Animal.prototype); // true\nconsole.log(Animal.prototype.__proto__ === Object.prototype); // true\n</pre><p>? The <strong>prototype chain</strong> looks like this:</p><p> <code>dog.__proto__</code> â†’ <code>Animal.prototype</code> â†’ <code>Object.prototype</code> â†’ <code>null</code></p><h2><strong>5ï¸âƒ£ When to Use </strong><code><strong>prototype</strong></code><strong> vs </strong><code><strong>__proto__</strong></code></h2><p>âœ… <strong>Use </strong><code><strong>prototype</strong></code><strong> when defining methods on a constructor function</strong></p><p> âœ… <strong>Use </strong><code><strong>__proto__</strong></code><strong> to access an object\'s prototype (for debugging, not modification)</strong></p><p> ? <strong>Avoid modifying </strong><code><strong>__proto__</strong></code><strong> directly; use </strong><code><strong>Object.setPrototypeOf()</strong></code><strong> instead</strong></p><p><br></p>'),(15,2,' Differences between declaring variables using var, let and const.','<p><img src=\"data:image/png;base64,\"></p>'),(16,1,'What is autoboxing and unboxing?','<p><strong>Autoboxing:</strong> Converting a primitive type into its wrapper class object (<code>int â†’ Integer</code>).</p><p><strong>Unboxing:</strong> Converting a wrapper class object into its primitive type (<code>Integer â†’ int</code>).</p>'),(17,1,'Can you override a static method in Java? Why or why not?','<p>We can declare static methods with the same signature in the subclass, but it is not considered overriding as there wonâ€™t be any run-time polymorphism. Hence the answer is â€˜Noâ€™.&nbsp;</p><p>If a derived class defines a static method with the same signature as a static method in the base class, the method in the derived class is hidden by the method in the base class. </p><p><br></p><p><br></p><p><br></p><p>https://www.geeksforgeeks.org/can-we-overload-or-override-static-methods-in-java/</p>'),(18,1,'What is the difference between final, finally, and finalize?','<p><code>final</code>: Used for <strong>variables (constant), methods (cannot override), and classes (cannot inherit)</strong>.</p><p><code>finally</code>: A block that <strong>always executes</strong> in exception handling.</p><p><code>finalize()</code>: A method called by the <strong>Garbage Collector before object destruction</strong>.</p><p><br></p><p><br></p><p>https://www.geeksforgeeks.org/finalize-method-in-java-and-how-to-override-it/</p>'),(19,1,'What is the difference between HashMap and Hashtable?','<p>https://www.scaler.com/topics/difference-between-hashmap-and-hashtable/</p>'),(20,1,'Why is String immutable in Java?','<p>https://www.geeksforgeeks.org/java-string-is-immutable-what-exactly-is-the-meaning/</p>'),(21,5,'Explain junit and mockito annotation.. How to test controller and service etc.','<p>Here are detailed <strong>Mockito and JUnit</strong> notes for your interview preparation:</p><h1><strong>Mockito and JUnit Notes for Interview</strong></h1><h2><strong>1. JUnit Overview</strong></h2><p>JUnit is a <strong>Java testing framework</strong> used for writing unit tests. It helps verify that individual components of an application work as expected.</p><p><br></p><h3><strong>Key Features of JUnit</strong></h3><ul><li><strong>Annotations-based testing</strong> (<code>@Test</code>, <code>@BeforeEach</code>, <code>@AfterEach</code>, etc.).</li><li>Supports <strong>assertions</strong> (<code>assertEquals</code>, <code>assertTrue</code>, <code>assertThrows</code>, etc.).</li><li><strong>Test lifecycle methods</strong> for setup and cleanup.</li><li>Can be integrated with <strong>Maven, Gradle</strong>, and testing frameworks like <strong>Mockito</strong>.</li></ul><h3><strong>Commonly Used JUnit 5 Annotations</strong></h3><ul><li><code>@Test</code> â†’ Marks a method as a test case.</li><li><code>@BeforeEach</code> â†’ Runs before each test (setup method).</li><li><code>@AfterEach</code> â†’ Runs after each test (cleanup method).</li><li><code>@BeforeAll</code> â†’ Runs once before all tests (for static setup).</li><li><code>@AfterAll</code> â†’ Runs once after all tests (for static cleanup).</li><li><code>@Disabled</code> â†’ Skips a test.</li></ul><h3><strong>Assertions in JUnit</strong></h3><p>Assertions are used to validate test results:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">assertEquals(expected, actual); // Checks if values are equal\nassertTrue(condition); // Passes if condition is true\nassertFalse(condition); // Passes if condition is false\nassertThrows(Exception.class, () -&gt; methodCall()); // Checks if exception is thrown\n</pre><h3><strong>Example of a JUnit Test</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">import org.junit.jupiter.api.Test;\nimport static org.junit.jupiter.api.Assertions.assertEquals;\n\nclass CalculatorTest {\n    @Test\n    void testAddition() {\n        int result = 2 + 3;\n        assertEquals(5, result, \"Addition should return correct sum\");\n    }\n}\n</pre><h2><strong>2. Mockito Overview</strong></h2><p>Mockito is a <strong>Java mocking framework</strong> used for writing unit tests by simulating dependencies.</p><p><br></p><h3><strong>Why Use Mockito?</strong></h3><ul><li>To <strong>mock dependencies</strong> (databases, services, APIs) and isolate unit tests.</li><li>Helps in <strong>testing methods independently</strong> without actual implementations.</li><li>Supports <strong>behavior verification</strong> (<code>verify()</code>, <code>times()</code>, <code>never()</code>).</li><li>Can return <strong>custom values</strong> using <code>when().thenReturn()</code>.</li></ul><h3><strong>Common Mockito Annotations</strong></h3><ul><li><code>@Mock</code> â†’ Creates a mock object.</li><li><code>@InjectMocks</code> â†’ Injects mocked dependencies into the tested class.</li><li><code>@Spy</code> â†’ Partially mocks a real object, calling real methods unless specified.</li><li><code>@Captor</code> â†’ Captures arguments passed to a mocked method.</li></ul><h3><strong>Mocking Dependencies in Unit Tests</strong></h3><h4><strong>Example: Mocking a Repository in a Service Class</strong></h4><pre class=\"ql-syntax\" spellcheck=\"false\">import static org.mockito.Mockito.*;\nimport static org.junit.jupiter.api.Assertions.*;\nimport org.junit.jupiter.api.Test;\nimport org.junit.jupiter.api.extension.ExtendWith;\nimport org.mockito.InjectMocks;\nimport org.mockito.Mock;\nimport org.mockito.junit.jupiter.MockitoExtension;\nimport java.util.Optional;\n\n@ExtendWith(MockitoExtension.class) // Enables Mockito in JUnit 5\nclass UserServiceTest {\n\n    @Mock\n    private UserRepository userRepository;\n\n    @InjectMocks\n    private UserService userService;\n\n    @Test\n    void testGetUserById() {\n        // Arrange\n        User mockUser = new User(1L, \"John Doe\");\n        when(userRepository.findById(1L)).thenReturn(Optional.of(mockUser));\n\n        // Act\n        User user = userService.getUserById(1L);\n\n        // Assert\n        assertEquals(\"John Doe\", user.getName());\n        verify(userRepository, times(1)).findById(1L); // Verify method call\n    }\n}\n</pre><h2><strong>3. Mockito Stubbing and Verification</strong></h2><h3><strong>Mocking Return Values</strong></h3><p>You can define what a mock should return:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">when(mockObject.methodCall()).thenReturn(value);\n</pre><p>Example:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">when(userRepository.findById(1L)).thenReturn(Optional.of(new User(1L, \"John\")));\n</pre><h3><strong>Mocking Exceptions</strong></h3><p>If a method should throw an exception:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">when(mockObject.methodCall()).thenThrow(new RuntimeException(\"Error\"));\n</pre><p>Example:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">when(userService.getUserById(100L)).thenThrow(new RuntimeException(\"User not found\"));\n</pre><h3><strong>Verifying Method Calls</strong></h3><p>Mockito allows verifying if a method was called:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">verify(mockObject).methodCall();\nverify(mockObject, times(1)).methodCall(); // Called once\nverify(mockObject, never()).methodCall(); // Never called\nverify(mockObject, atLeast(2)).methodCall(); // At least twice\n</pre><h2><strong>4. Unit Testing a Spring Boot Controller</strong></h2><h3><strong>Using </strong><code><strong>MockMvc</strong></code><strong> for Controller Testing</strong></h3><p>Spring Boot controllers can be tested using <code>MockMvc</code>:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">import static org.springframework.test.web.servlet.request.MockMvcRequestBuilders.get;\nimport static org.springframework.test.web.servlet.result.MockMvcResultMatchers.*;\nimport static org.mockito.Mockito.*;\n\nimport org.junit.jupiter.api.Test;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.boot.test.autoconfigure.web.servlet.AutoConfigureMockMvc;\nimport org.springframework.boot.test.context.SpringBootTest;\nimport org.springframework.boot.test.mock.mockito.MockBean;\nimport org.springframework.test.web.servlet.MockMvc;\n\n@SpringBootTest\n@AutoConfigureMockMvc\nclass UserControllerTest {\n\n    @Autowired\n    private MockMvc mockMvc;\n\n    @MockBean\n    private UserService userService;\n\n    @Test\n    void testGetUser() throws Exception {\n        User mockUser = new User(1L, \"John Doe\");\n        when(userService.getUserById(1L)).thenReturn(mockUser);\n\n        mockMvc.perform(get(\"/users/1\"))\n                .andExpect(status().isOk())\n                .andExpect(jsonPath(\"$.name\").value(\"John Doe\"));\n    }\n}\n</pre><h2><strong>5. Key Differences Between JUnit and Mockito</strong></h2><ol><li><strong>JUnit is for testing, Mockito is for mocking</strong>.</li><li><strong>JUnit verifies results using assertions</strong>, while <strong>Mockito verifies behavior (method calls, parameters, etc.)</strong>.</li><li><strong>Mockito requires </strong><code><strong>when().thenReturn()</strong></code><strong> for stubbing</strong> methods, whereas JUnit does not.</li><li><strong>JUnit can work without Mockito</strong>, but Mockito is typically used <strong>along with JUnit</strong> for testing classes that have dependencies.</li></ol><h2><strong>6. Best Practices for JUnit and Mockito</strong></h2><p>âœ… <strong>Keep tests isolated</strong> â€“ Each test should run independently.</p><p> âœ… <strong>Use </strong><code><strong>@Mock</strong></code><strong> for dependencies</strong>, instead of creating real objects.</p><p> âœ… <strong>Use </strong><code><strong>@InjectMocks</strong></code> to inject mocks automatically.</p><p> âœ… <strong>Verify behavior</strong> with <code>verify()</code>, especially for void methods.</p><p> âœ… <strong>Use </strong><code><strong>@SpringBootTest</strong></code><strong> carefully</strong>, as it loads the entire Spring context (slower).</p><p> âœ… <strong>Write both unit tests (with Mockito) and integration tests (with </strong><code><strong>@SpringBootTest</strong></code><strong>)</strong>.</p><p> âœ… <strong>Follow the Arrange-Act-Assert (AAA) pattern</strong> for better test readability.</p><h2><strong>7. Summary</strong></h2><ul><li><strong>JUnit</strong> is used for writing test cases.</li><li><strong>Mockito</strong> is used for mocking dependencies.</li><li><code><strong>@Mock</strong></code> creates a fake dependency, while <code><strong>@InjectMocks</strong></code> injects it into the class.</li><li><strong>Use </strong><code><strong>when().thenReturn()</strong></code><strong> to mock method behavior</strong>.</li><li><strong>Use </strong><code><strong>verify()</strong></code><strong> to check method interactions</strong>.</li><li><strong>MockMvc is used for testing controllers</strong>.</li></ul><p>With this knowledge, you are well-prepared for <strong>JUnit and Mockito</strong> questions in interviews! ?</p>'),(22,6,'How to find minimum spanning tree?','<p>https://www.geeksforgeeks.org/what-is-minimum-spanning-tree-mst/</p>'),(23,4,'What are Load balancing Algorithm?','<p><a href=\"https://docs.google.com/document/d/1jpLKXMTJhSExkZjM-D6B0oA9t44yrcbINQUZhyQ2jUY/edit?tab=t.0\" rel=\"noopener noreferrer\" target=\"_blank\">Link</a></p>'),(24,7,'Explain solid principle','<h3><strong>SOLID Principles in Java (With Examples)</strong></h3><p>SOLID principles help in writing <strong>maintainable, scalable, and testable</strong> code in object-oriented programming.</p><h2><strong>1ï¸âƒ£ Single Responsibility Principle (SRP)</strong></h2><p>? <strong>Definition</strong>: A class should have <strong>only one reason to change</strong>.</p><p> ? <strong>Problem</strong>: If a class does too much, modifying one feature may <strong>break another feature</strong>.</p><p>âœ… <strong>Example: Bad Design (Violates SRP)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">class Report {\n    public void generateReport() {\n        System.out.println(\"Generating report...\");\n    }\n    \n    public void saveToFile(String filename) {\n        System.out.println(\"Saving report to \" + filename);\n    }\n}\n</pre><ul><li>The class handles <strong>both report generation &amp; file saving</strong>.</li><li>If we need to change <strong>file storage logic</strong>, we must modify this class, violating SRP.</li></ul><p>âœ… <strong>Example: Good Design (Follows SRP)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">class Report {\n    public void generateReport() {\n        System.out.println(\"Generating report...\");\n    }\n}\n\nclass ReportSaver {\n    public void saveToFile(String filename) {\n        System.out.println(\"Saving report to \" + filename);\n    }\n}\n</pre><ul><li>Now, <strong>Report</strong> is only responsible for <strong>generating</strong> reports.</li><li><strong>ReportSaver</strong> is responsible for <strong>saving</strong> them.</li></ul><h2><strong>2ï¸âƒ£ Open/Closed Principle (OCP)</strong></h2><p>? <strong>Definition</strong>: A class should be <strong>open for extension but closed for modification</strong>.</p><p> ? <strong>Problem</strong>: If we modify existing classes every time we add new features, it becomes <strong>hard to maintain</strong>.</p><p>âœ… <strong>Example: Bad Design (Violates OCP)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">class PaymentProcessor {\n    public void pay(String method) {\n        if (method.equals(\"CreditCard\")) {\n            System.out.println(\"Processing credit card payment...\");\n        } else if (method.equals(\"PayPal\")) {\n            System.out.println(\"Processing PayPal payment...\");\n        }\n    }\n}\n</pre><ul><li>If we add <strong>UPI payments</strong>, we must <strong>modify the existing class</strong>.</li></ul><p>âœ… <strong>Example: Good Design (Follows OCP)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">interface PaymentMethod {\n    void pay();\n}\n\nclass CreditCardPayment implements PaymentMethod {\n    public void pay() {\n        System.out.println(\"Processing credit card payment...\");\n    }\n}\n\nclass PayPalPayment implements PaymentMethod {\n    public void pay() {\n        System.out.println(\"Processing PayPal payment...\");\n    }\n}\n\nclass PaymentProcessor {\n    public void processPayment(PaymentMethod method) {\n        method.pay();\n    }\n}\n</pre><ul><li>Now, adding <strong>new payment methods</strong> (UPI, Bitcoin, etc.) doesn\'t modify existing code.</li><li>Instead, we <strong>extend</strong> by adding new implementations.</li></ul><h2><strong>3ï¸âƒ£ Liskov Substitution Principle (LSP)</strong></h2><p>? <strong>Definition</strong>: Subclasses should be <strong>replaceable</strong> with their parent class without affecting correctness.</p><p> ? <strong>Problem</strong>: If a subclass changes how the parent class behaves, <strong>unexpected bugs</strong> may occur.</p><p>âœ… <strong>Example: Bad Design (Violates LSP)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">class Bird {\n    public void fly() {\n        System.out.println(\"Bird is flying\");\n    }\n}\n\nclass Penguin extends Bird {\n    @Override\n    public void fly() {\n        throw new UnsupportedOperationException(\"Penguins can\'t fly!\");\n    }\n}\n</pre><ul><li><code>Penguin</code> <strong>inherits </strong><code><strong>fly()</strong></code><strong> but cannot actually fly</strong>.</li><li>Calling <code>penguin.fly()</code> <strong>breaks</strong> the expected behavior.</li></ul><p>âœ… <strong>Example: Good Design (Follows LSP)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">interface FlyingBird {\n    void fly();\n}\n\nclass Sparrow implements FlyingBird {\n    public void fly() {\n        System.out.println(\"Sparrow is flying\");\n    }\n}\n\nclass Penguin {\n    public void swim() {\n        System.out.println(\"Penguin is swimming\");\n    }\n}\n</pre><ul><li><code>Sparrow</code> can fly âœ…</li><li><code>Penguin</code> does not inherit <code>fly()</code>, preventing misuse âœ…</li></ul><h2><strong>4ï¸âƒ£ Interface Segregation Principle (ISP)</strong></h2><p>? <strong>Definition</strong>: A class should <strong>not be forced to implement methods it doesnâ€™t use</strong>.</p><p> ? <strong>Problem</strong>: Large interfaces force <strong>unnecessary methods</strong> on classes.</p><p>âœ… <strong>Example: Bad Design (Violates ISP)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">interface Worker {\n    void work();\n    void eat();\n}\n\nclass Robot implements Worker {\n    public void work() {\n        System.out.println(\"Robot is working\");\n    }\n    \n    public void eat() {\n        throw new UnsupportedOperationException(\"Robots don\'t eat!\");\n    }\n}\n</pre><ul><li><code>Robot</code> <strong>doesn\'t need </strong><code><strong>eat()</strong></code>, but it\'s forced to implement it.</li></ul><p>âœ… <strong>Example: Good Design (Follows ISP)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">interface Workable {\n    void work();\n}\n\ninterface Eatable {\n    void eat();\n}\n\nclass Robot implements Workable {\n    public void work() {\n        System.out.println(\"Robot is working\");\n    }\n}\n\nclass Human implements Workable, Eatable {\n    public void work() {\n        System.out.println(\"Human is working\");\n    }\n\n    public void eat() {\n        System.out.println(\"Human is eating\");\n    }\n}\n</pre><ul><li><code>Robot</code> <strong>only implements work</strong> âœ…</li><li><code>Human</code> <strong>implements both work &amp; eat</strong> âœ…</li></ul><h2><strong>5ï¸âƒ£ Dependency Inversion Principle (DIP)</strong></h2><p>? <strong>Definition</strong>: <strong>High-level modules should not depend on low-level modules. Both should depend on abstractions (interfaces).</strong></p><p> ? <strong>Problem</strong>: If high-level modules depend directly on low-level modules, the system becomes <strong>hard to change</strong>.</p><p>âœ… <strong>Example: Bad Design (Violates DIP)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">class MySQLDatabase {\n    public void connect() {\n        System.out.println(\"Connected to MySQL\");\n    }\n}\n\nclass DataFetcher {\n    private MySQLDatabase db;\n\n    public DataFetcher() {\n        this.db = new MySQLDatabase();  // Direct dependency!\n    }\n\n    public void fetchData() {\n        db.connect();\n        System.out.println(\"Fetching data...\");\n    }\n}\n</pre><ul><li><code>DataFetcher</code> <strong>depends directly</strong> on <code>MySQLDatabase</code>.</li><li>If we switch to <code>PostgreSQL</code>, we <strong>must modify </strong><code><strong>DataFetcher</strong></code>.</li></ul><p>âœ… <strong>Example: Good Design (Follows DIP)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">interface Database {\n    void connect();\n}\n\nclass MySQLDatabase implements Database {\n    public void connect() {\n        System.out.println(\"Connected to MySQL\");\n    }\n}\n\nclass PostgreSQLDatabase implements Database {\n    public void connect() {\n        System.out.println(\"Connected to PostgreSQL\");\n    }\n}\n\nclass DataFetcher {\n    private Database db;\n\n    public DataFetcher(Database db) {\n        this.db = db;  // Now it\'s flexible!\n    }\n\n    public void fetchData() {\n        db.connect();\n        System.out.println(\"Fetching data...\");\n    }\n}\n\npublic class Main {\n    public static void main(String[] args) {\n        Database mysql = new MySQLDatabase();\n        Database postgres = new PostgreSQLDatabase();\n\n        DataFetcher fetcher1 = new DataFetcher(mysql);\n        fetcher1.fetchData();\n\n        DataFetcher fetcher2 = new DataFetcher(postgres);\n        fetcher2.fetchData();\n    }\n}\n</pre><ul><li><code>DataFetcher</code> <strong>depends on </strong><code><strong>Database</strong></code><strong> (interface), not a specific DB</strong>.</li><li>Now, <strong>we can swap databases without modifying </strong><code><strong>DataFetcher</strong></code> âœ….</li></ul><h3><strong>? How to Apply SOLID?</strong></h3><p>âœ… Use <strong>SRP</strong> when classes feel overloaded</p><p> âœ… Use <strong>OCP</strong> when adding new features requires modifying old code</p><p> âœ… Use <strong>LSP</strong> to ensure subclasses behave as expected</p><p> âœ… Use <strong>ISP</strong> to split large interfaces into smaller, specialized ones</p><p> âœ… Use <strong>DIP</strong> to make high-level modules <strong>independent of low-level modules</strong></p><p>Would you like a <strong>practice problem</strong> to test your SOLID understanding? ?</p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><img src=\"data:image/png;base64,\"></p>'),(25,8,'Explain prototype pattern','<p>https://www.scaler.com/topics/design-patterns/prototype-design-pattern/</p><p><br></p><p>https://refactoring.guru/design-patterns/prototype/java/example</p>'),(26,8,'Builder pattern','<h2><strong>Builder Pattern - Explained with Examples</strong></h2><p>The <strong>Builder Pattern</strong> is a <strong>creational design pattern</strong> that helps construct <strong>complex objects step by step</strong> without exposing their details. Instead of using a long constructor with many parameters, we create objects <strong>incrementally</strong> using a <strong>Builder class</strong>.</p><h2><strong>? Problem Without Builder Pattern (Telescoping Constructor Issue)</strong></h2><p>Imagine a <code>Car</code> class with multiple optional fields:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">public class Car {\n    private String engine;\n    private int wheels;\n    private boolean sunroof;\n    private boolean GPS;\n    \n    public Car(String engine, int wheels, boolean sunroof, boolean GPS) {\n        this.engine = engine;\n        this.wheels = wheels;\n        this.sunroof = sunroof;\n        this.GPS = GPS;\n    }\n}\n</pre><h3><strong>Problem:</strong></h3><ul><li>If a class has many optional parameters, the constructor becomes <strong>hard to read and maintain</strong>.</li><li><strong>Order-dependent</strong> â†’ You must remember the correct sequence of parameters.</li></ul><h2><strong>? Solution: Using Builder Pattern</strong></h2><p>Instead of using multiple constructors, we <strong>use a Builder class</strong> that allows <strong>step-by-step object creation</strong>.</p><p><br></p><h3><strong>Step 1: Define the </strong><code><strong>Car</strong></code><strong> class with a private constructor</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">public class Car {\n    private String engine;\n    private int wheels;\n    private boolean sunroof;\n    private boolean GPS;\n\n    // Private constructor to restrict direct object creation\n    private Car(CarBuilder builder) {\n        this.engine = builder.engine;\n        this.wheels = builder.wheels;\n        this.sunroof = builder.sunroof;\n        this.GPS = builder.GPS;\n    }\n\n    @Override\n    public String toString() {\n        return \"Car [Engine=\" + engine + \", Wheels=\" + wheels +\n               \", Sunroof=\" + sunroof + \", GPS=\" + GPS + \"]\";\n    }\n\n    // Static Nested Builder Class\n    public static class CarBuilder {\n        private String engine;\n        private int wheels;\n        private boolean sunroof;\n        private boolean GPS;\n\n        // Required parameters\n        public CarBuilder(String engine, int wheels) {\n            this.engine = engine;\n            this.wheels = wheels;\n        }\n\n        // Optional parameters with builder pattern\n        public CarBuilder setSunroof(boolean sunroof) {\n            this.sunroof = sunroof;\n            return this; // Allows method chaining\n        }\n\n        public CarBuilder setGPS(boolean GPS) {\n            this.GPS = GPS;\n            return this;\n        }\n\n        // Build method to create an instance of Car\n        public Car build() {\n            return new Car(this);\n        }\n    }\n}\n</pre><h2><strong>? Using the Builder Pattern to Create Objects</strong></h2><pre class=\"ql-syntax\" spellcheck=\"false\">public class Main {\n    public static void main(String[] args) {\n        Car car1 = new Car.CarBuilder(\"V8\", 4)\n                .setSunroof(true)\n                .setGPS(true)\n                .build();\n\n        Car car2 = new Car.CarBuilder(\"V6\", 4)\n                .setGPS(false)\n                .build();\n\n        System.out.println(car1);\n        System.out.println(car2);\n    }\n}\n</pre><p>âœ… <strong>Output:</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">Car [Engine=V8, Wheels=4, Sunroof=true, GPS=true]\nCar [Engine=V6, Wheels=4, Sunroof=false, GPS=false]\n</pre><h2><strong>?  When to Use Builder Pattern?</strong></h2><ul><li>When a class has <strong>many optional parameters</strong>.</li><li>When you want to <strong>avoid long, unreadable constructors</strong>.</li><li>When object creation <strong>needs to be flexible</strong> (step-by-step).</li><li>When the created object <strong>should be immutable</strong>.</li></ul><h2><strong>? Real-World Example: Spring Boot Configuration</strong></h2><p>Spring Bootâ€™s <code>HttpClient</code> uses <strong>Builder Pattern</strong> to configure HTTP requests:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">HttpClient client = HttpClient.newBuilder()\n    .connectTimeout(Duration.ofSeconds(10))\n    .followRedirects(HttpClient.Redirect.NORMAL)\n    .build();\n</pre><p>Would you like me to explain this in a <strong>Spring Boot context</strong> with a real-world service example? ?</p><p><br></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p>'),(27,8,'Chain of Responsibility Pattern','<h3><strong>Chain of Responsibility Pattern â€“ Another Real-World Example</strong></h3><p>Let\'s implement <strong>ATM withdrawal processing</strong> using the Chain of Responsibility pattern.</p><h3><strong>? Scenario</strong></h3><p>Imagine an <strong>ATM machine</strong> that dispenses cash using different denominations:</p><p><br></p><ul><li><strong>â‚¹2000</strong>, <strong>â‚¹500</strong>, <strong>â‚¹200</strong>, and <strong>â‚¹100</strong> notes.</li><li>When a user requests an amount, the ATM should dispense <strong>the highest denominations first</strong> and pass the remaining amount down the chain.</li></ul><h3><strong>? Step 1: Create the Handler Interface</strong></h3><p>Each handler (denomination) will process the request and pass the remaining amount forward.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">abstract class CashDispenser {\n    protected CashDispenser nextDispenser;\n\n    public void setNextDispenser(CashDispenser nextDispenser) {\n        this.nextDispenser = nextDispenser;\n    }\n\n    public void dispense(int amount) {\n        if (amount &gt;= getDenomination()) {\n            int numNotes = amount / getDenomination();\n            int remainder = amount % getDenomination();\n            System.out.println(\"Dispensing \" + numNotes + \" notes of â‚¹\" + getDenomination());\n\n            if (remainder != 0 &amp;&amp; nextDispenser != null) {\n                nextDispenser.dispense(remainder);\n            }\n        } else if (nextDispenser != null) {\n            nextDispenser.dispense(amount);\n        }\n    }\n\n    protected abstract int getDenomination();\n}\n</pre><h3><strong>? Step 2: Create Concrete Handlers</strong></h3><p>Each handler represents a currency note and processes its part of the withdrawal.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">class Rupee2000Dispenser extends CashDispenser {\n    protected int getDenomination() {\n        return 2000;\n    }\n}\n\nclass Rupee500Dispenser extends CashDispenser {\n    protected int getDenomination() {\n        return 500;\n    }\n}\n\nclass Rupee200Dispenser extends CashDispenser {\n    protected int getDenomination() {\n        return 200;\n    }\n}\n\nclass Rupee100Dispenser extends CashDispenser {\n    protected int getDenomination() {\n        return 100;\n    }\n}\n</pre><h3><strong>? Step 3: Setup the Chain and Process Withdrawal</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">public class ATMWithdrawal {\n    public static void main(String[] args) {\n        CashDispenser dispenser2000 = new Rupee2000Dispenser();\n        CashDispenser dispenser500 = new Rupee500Dispenser();\n        CashDispenser dispenser200 = new Rupee200Dispenser();\n        CashDispenser dispenser100 = new Rupee100Dispenser();\n\n        // Setting up the chain\n        dispenser2000.setNextDispenser(dispenser500);\n        dispenser500.setNextDispenser(dispenser200);\n        dispenser200.setNextDispenser(dispenser100);\n\n        // Withdraw â‚¹3700\n        System.out.println(\"Withdrawing â‚¹3700:\");\n        dispenser2000.dispense(3700);\n    }\n}\n</pre><h3><strong>? Output</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\">Withdrawing â‚¹3700:\nDispensing 1 notes of â‚¹2000\nDispensing 3 notes of â‚¹500\nDispensing 1 notes of â‚¹200\n</pre><ul><li>The <strong>â‚¹2000</strong> dispenser handles â‚¹2000.</li><li>The <strong>â‚¹500</strong> dispenser handles â‚¹1500 (3 Ã— â‚¹500).</li><li>The <strong>â‚¹200</strong> dispenser handles â‚¹200.</li><li>The <strong>â‚¹100</strong> dispenser is <strong>not needed</strong>.</li></ul><h3><strong>? Why Use Chain of Responsibility Here?</strong></h3><p>âœ… <strong>Scalability:</strong> We can easily add new denominations without modifying existing code.</p><p> âœ… <strong>Separation of Concerns:</strong> Each dispenser is responsible for only one denomination.</p><p> âœ… <strong>Flexibility:</strong> The chain order can be modified based on availability of cash.</p><p>Would you like me to refine this or show an example related to Spring Boot middleware handling? ?</p>'),(28,8,'Iterator design pattern','<h2><strong>Iterator Design Pattern â€“ Explained with Real-World Example</strong></h2><p>The <strong>Iterator Pattern</strong> is a <strong>behavioral design pattern</strong> that provides a way to <strong>access elements of a collection</strong> sequentially without exposing its underlying representation.</p><h3><strong>? Real-World Analogy: TV Remote with Channel Surfing</strong></h3><p>Imagine you have a <strong>TV remote</strong> that lets you switch between channels <strong>one by one</strong> without knowing how the channels are stored inside. The <strong>Iterator Pattern</strong> is like the <strong>\"Next Channel\"</strong> and <strong>\"Previous Channel\"</strong> buttons on a remote.</p><h2><strong>? Step 1: Create an Iterator Interface</strong></h2><p>This defines methods to navigate through a collection.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">interface Iterator&lt;T&gt; {\n    boolean hasNext(); // Checks if there\'s another element\n    T next();          // Returns the next element\n}\n</pre><h2><strong>? Step 2: Create a Collection Interface</strong></h2><p>This provides a method to get the iterator.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">interface ChannelCollection {\n    Iterator&lt;String&gt; createIterator();\n}\n</pre><h2><strong>? Step 3: Implement the Collection and Iterator</strong></h2><p>We create a <strong>ChannelList</strong> class that holds TV channels and provides an iterator.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">import java.util.List;\nimport java.util.ArrayList;\n\nclass ChannelList implements ChannelCollection {\n    private List&lt;String&gt; channels;\n\n    public ChannelList() {\n        this.channels = new ArrayList&lt;&gt;();\n    }\n\n    public void addChannel(String channel) {\n        channels.add(channel);\n    }\n\n    @Override\n    public Iterator&lt;String&gt; createIterator() {\n        return new ChannelIterator(channels);\n    }\n}\n\n// Concrete Iterator Implementation\nclass ChannelIterator implements Iterator&lt;String&gt; {\n    private List&lt;String&gt; channels;\n    private int position = 0;\n\n    public ChannelIterator(List&lt;String&gt; channels) {\n        this.channels = channels;\n    }\n\n    @Override\n    public boolean hasNext() {\n        return position &lt; channels.size();\n    }\n\n    @Override\n    public String next() {\n        return channels.get(position++);\n    }\n}\n</pre><h2><strong>? Step 4: Test the Iterator Pattern</strong></h2><pre class=\"ql-syntax\" spellcheck=\"false\">public class IteratorPatternExample {\n    public static void main(String[] args) {\n        ChannelList channelList = new ChannelList();\n        channelList.addChannel(\"HBO\");\n        channelList.addChannel(\"Netflix\");\n        channelList.addChannel(\"Disney+\");\n        channelList.addChannel(\"Amazon Prime\");\n\n        Iterator&lt;String&gt; iterator = channelList.createIterator();\n\n        System.out.println(\"TV Channels:\");\n        while (iterator.hasNext()) {\n            System.out.println(iterator.next());\n        }\n    }\n}\n</pre><h2><strong>? Output</strong></h2><pre class=\"ql-syntax\" spellcheck=\"false\">TV Channels:\nHBO\nNetflix\nDisney+\nAmazon Prime\n</pre><h2><strong>? Why Use Iterator Pattern?</strong></h2><p>âœ… <strong>Encapsulation</strong> â€“ It hides the internal structure of a collection.</p><p> âœ… <strong>Simplifies Traversal</strong> â€“ Makes it easy to iterate without knowing the underlying data structure.</p><p> âœ… <strong>Supports Multiple Iterators</strong> â€“ Different iterators can be used for different traversal strategies (e.g., reverse iteration).</p><p> âœ… <strong>Consistent Interface</strong> â€“ Allows access to different types of collections uniformly.</p><h2><strong>? Real-World Applications</strong></h2><ul><li><strong>Java Collections Framework</strong> (<code>Iterator</code>, <code>ListIterator</code>)</li><li><strong>Database Cursors</strong> (to iterate over query results)</li><li><strong>File System Navigation</strong> (traversing directories and files)</li></ul><p>Would you like an <strong>example with Java\'s built-in </strong><code><strong>Iterator</strong></code> or something related to <strong>Spring Boot</strong>? ?</p>'),(29,8,'Template Method Design Pattern','<h2><strong>Template Method Design Pattern â€“ Explained with Real-World Example</strong></h2><p>The <strong>Template Method Pattern</strong> is a <strong>behavioral design pattern</strong> that defines the <strong>skeleton (template) of an algorithm</strong> in a superclass but <strong>lets subclasses modify certain steps</strong> of the algorithm <strong>without changing its structure</strong>.</p><h3><strong>? Real-World Analogy: Making Tea vs. Making Coffee</strong></h3><p>Think about making <strong>tea</strong> and <strong>coffee</strong>:</p><p><br></p><ul><li>Both involve <strong>boiling water, adding ingredients, and serving</strong>.</li><li>The <strong>core steps</strong> are the <strong>same</strong>, but the <strong>specific steps (tea leaves vs. coffee powder)</strong> are different.</li><li>We can define a <strong>template</strong> for making a hot beverage and let subclasses <strong>implement the details</strong>.</li></ul><h2><strong>? Step 1: Create an Abstract Class with a Template Method</strong></h2><p>The <code>prepareBeverage()</code> method <strong>defines the steps</strong> but allows subclasses to <strong>customize</strong> them.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">abstract class BeverageTemplate {\n    \n    // Template method - defines the algorithm\n    public final void prepareBeverage() {\n        boilWater();\n        addIngredients();\n        pourInCup();\n        addCondiments();\n    }\n\n    private void boilWater() {\n        System.out.println(\"Boiling water...\");\n    }\n\n    private void pourInCup() {\n        System.out.println(\"Pouring into cup...\");\n    }\n\n    // Steps that subclasses will implement differently\n    abstract void addIngredients();\n    abstract void addCondiments();\n}\n</pre><h2><strong>? Step 2: Implement Concrete Classes</strong></h2><p>Each subclass <strong>modifies only the necessary parts</strong>.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">class Tea extends BeverageTemplate {\n    @Override\n    void addIngredients() {\n        System.out.println(\"Adding tea leaves...\");\n    }\n\n    @Override\n    void addCondiments() {\n        System.out.println(\"Adding lemon...\");\n    }\n}\n\nclass Coffee extends BeverageTemplate {\n    @Override\n    void addIngredients() {\n        System.out.println(\"Adding coffee powder...\");\n    }\n\n    @Override\n    void addCondiments() {\n        System.out.println(\"Adding sugar and milk...\");\n    }\n}\n</pre><h2><strong>? Step 3: Test the Template Pattern</strong></h2><pre class=\"ql-syntax\" spellcheck=\"false\">public class TemplatePatternExample {\n    public static void main(String[] args) {\n        System.out.println(\"Making Tea:\");\n        BeverageTemplate tea = new Tea();\n        tea.prepareBeverage();\n        \n        System.out.println(\"\\nMaking Coffee:\");\n        BeverageTemplate coffee = new Coffee();\n        coffee.prepareBeverage();\n    }\n}\n</pre><h2><strong>? Output</strong></h2><pre class=\"ql-syntax\" spellcheck=\"false\">Making Tea:\nBoiling water...\nAdding tea leaves...\nPouring into cup...\nAdding lemon...\n\nMaking Coffee:\nBoiling water...\nAdding coffee powder...\nPouring into cup...\nAdding sugar and milk...\n</pre><h2><strong>? Why Use the Template Method Pattern?</strong></h2><p>âœ… <strong>Encapsulation</strong> â€“ The common steps are hidden in the base class.</p><p> âœ… <strong>Code Reusability</strong> â€“ Avoids duplicating common steps in every subclass.</p><p> âœ… <strong>Flexibility</strong> â€“ Subclasses <strong>customize only specific parts</strong> of the algorithm.</p><p> âœ… <strong>Consistent Workflow</strong> â€“ Ensures that the core steps <strong>always execute in the correct order</strong>.</p><h2><strong>? Real-World Applications</strong></h2><ul><li><strong>Spring Framework</strong>: <code>AbstractApplicationContext</code> (Spring lifecycle methods follow this pattern).</li><li><strong>Servlets in Java</strong>: <code>HttpServlet.doGet()</code> and <code>doPost()</code> override specific steps.</li><li><strong>Game Development</strong>: A <code>GameTemplate</code> can define a game loop with steps like <strong>initialize, start, play, and end</strong>.</li></ul><p>Would you like an <strong>example in Spring Boot or another domain</strong>? ?</p>'),(30,8,'All LLD problems','<p>https://www.lldcoding.com/lld-problems-sheet</p>');
